e(_image), // \n            RaisedButton(\n              color: Colors.grey,\n              shape: StadiumBorder(),\n              onPressed: () {\n                _getImage(ImageSource.gallery);\n              },\n              child: const CustomButtonText(buttonText: \"\")\n            ),\n            const SizedBox(\n              height: 20,\n            ),\n            RaisedButton(\n              color: Colors.grey,\n              shape: StadiumBorder(),\n              onPressed: () {\n                _getImage(ImageSource.camera);\n              },\n              child: const CustomButtonText(buttonText: \"\"),\n            ),\n          ],\n        ),\n      ),\n    );\n  }\n}\n``` \n\n RaisedButtonWidget\n\n```custom_button_text.dart\nimport 'package:flutter/material.dart';\n\nclass CustomButtonText extends StatelessWidget {\n  final buttonText;\n\n  const CustomButtonText({Key key, this.buttonText}) : super(key: key);\n\n  @override\n  Widget build(BuildContext context) {\n    return Container(\n      width: 200,\n      height: 40,\n      child: Center(\n        child: Text(\n          buttonText,\n          style: TextStyle(\n            color: Colors.white,\n            fontSize: 18,\n          ),\n        ),\n      ),\n    );\n  }\n}\n```\n\n## \n- image_picker : https://pub.dev/packages/image_picker\n\n",coediting:!1,comments_count:0,created_at:"2020-11-17T22:05:32+09:00",group:null,id:"0242481d92b04653ce86",likes_count:0,private:!1,reactions_count:0,tags:[{name:"Flutter",versions:[]}],title:"Flutterimage_picker",updated_at:"2020-11-17T22:05:32+09:00",url:"https://qiita.com/kedev01/items/0242481d92b04653ce86",user:{description:null,facebook_id:null,followees_count:0,followers_count:0,github_login_name:null,id:"kedev01",items_count:1,linkedin_id:null,location:null,name:"",organization:null,permanent_id:681808,profile_image_url:"https://abs.twimg.com/sticky/default_profile_images/default_profile_bigger.png",team_only:!1,twitter_screen_name:"kedev01",web